&quot;Be Here to Love Me&quot;
&quot;Kathleen&quot;
&quot;She Came and She Touched Me&quot;
&quot;Like A Summer Thursday&quot;
&quot;Our Mother The Mountain&quot;
&quot;Second Lovers Song&quot;
&quot;St. John The Gambler&quot;
&quot;Tecumseh Valley&quot;
&quot;Snake Mountain Blues
&quot;My Proud Mountains&quot;
